import React from 'react';
import { Tabs } from 'antd';
import 'antd/dist/antd.css';
import '../../Styles/PrincipalAdmin.css';

const { TabPane } = Tabs;

const App = () => {
  return (
    <div className="app-container">
      <Tabs
        defaultActiveKey="1"
        tabPosition="bottom"
        size="large"
        tabBarGutter={20}
        animated
        className="custom-tabs"
      >
        <TabPane tab="Opción 1" key="1">
          <h2>Contenido de la Opción 1</h2>
          <p>Aquí puedes agregar el contenido de la opción 1.</p>
        </TabPane>
        <TabPane tab="Opción 2" key="2">
          <h2>Contenido de la Opción 2</h2>
          <p>Aquí puedes agregar el contenido de la opción 2.</p>
        </TabPane>
        <TabPane tab="Opción 3" key="3">
          <h2>Contenido de la Opción 3</h2>
          <p>Aquí puedes agregar el contenido de la opción 3.</p>
        </TabPane>
      </Tabs>
    </div>
  );
};

export default App;
